import React from 'react';
import { useSelector } from 'react-redux';

import { selectDataCorona } from '../../redux/data/data.selectors';

import { HomeContainer, NameContainer, NumberContainer } from './myhome.styles';

const MyHome = () => {
	const dataCorona = useSelector(selectDataCorona);
	const countriesHarsh = dataCorona.reduce((map, obj) => {
		map[obj.name.replace(/\s+/g, '').toLowerCase()] = { ...obj };
		return map;
	}, {});
	const vietNam = countriesHarsh['vietnam'];
	const us = countriesHarsh['us'];
	return (
		<div>
			<HomeContainer>Khu tao song: {vietNam.name} </HomeContainer>
			<NameContainer></NameContainer>
			<NumberContainer></NumberContainer>
		</div>
	);
};

export default MyHome;
